// Original from: https://github.com/jeffleus/ionic-pdf/blob/master/www/js/reportBuilderSvc.js

//
// Report Service
//
// This service provides a dummy document definition for the purpose of this sample.  In
// my real world usage, I split documentDef creation from the reportPDF creation.  The RptBuilderSvc
// is used to receive inputs and return a JSON object w/ the report declarations.  This mock svc
// just creates some random progress matrix and draws a table to display.  The pdfMake.org site
// has a nice playground for drafting your report pieces.  My plan is to share the ionic-pdf
// so users can incorporate PDF generation and focus on creating their docDefs and using ionic-pdf
// to easily render
(function() {
  'use strict';
  // attach the factories and service to the [starter.services] module in angular
  angular.module('medprofolio')
    .service('ReportBuilderSvc', reportBuilderService);

  function reportBuilderService() {
    var self = this;

    self.generateReport = _generateReport;
    function _generateReport(profolio) {

     // console.log(profolio);

      // Generates the content to output a MedProfolio to pdf. Constructs
      // the content based on what the pdfmake library needs.
      function createContent(profolio){

        var content = [];

        // MedProfolio image
        content.push({
          image: 'medprofolioLogo',
          width: 500
        });

        // Name of user
        content.push({
          text: profolio.name,
          margin: [0,30,0,0],
          alignment: 'center',
          fontSize: 30,
          bold: true
        });

        // Certifications and licenses
        content.push({
          text: 'Certifications and Licenses',
          margin: [0,50,0,0],
          alignment: 'center',
          fontSize: 22
        });

        // Generated on [M/D/YYYY]
        var today = new Date();
        var d = today.getDate();
        var m = today.getMonth()+1;
        var yyyy = today.getFullYear();
        today = m+'/'+d+'/'+yyyy;
        content.push({
          text: '[Generated on ' + today + ']',
          alignment: 'center',
          fontSize: 18
        });

        // Table of Contents that lists all of the certifications

        console.log(profolio.certs.length);
        var tocBody = [];
        tocBody.push([{text: 'Title', style: 'tableHeader'}, { text: 'Expiration', style: 'tableHeader'}]);
        for(var i = 0; i < profolio.certs.length; i++){
          //console.log(profolio.certs[i].attributes.title);
          //console.log(profolio.certs[i].attributes.expiration);
          var expire = new Date(profolio.certs[i].attributes.expiration);
          var expireString = expire.getMonth() + '/' + expire.getDate() + '/' + expire.getFullYear();
          tocBody.push([profolio.certs[i].attributes.title, expireString]);
        }

        var t = {
          align: 'center',
          margin: [0,20,0,0],  // [left, top, right, bottom]
          table: {
            widths: [400, 100],
            headerRows: 1,
            body: tocBody
          }
        };

        content.push(t);

        // add each certificate
        for(var i = 0; i < profolio.certs.length; i++){

          // Title of Certificate
          content.push({
            text: profolio.certs[i].attributes.title,
            alignment: 'center',
            fontSize: 30,
            bold: true,
            underline: true,
            pageBreak: 'before',
            margin: [0,20,0,40]  // [left, top, right, bottom]
          });

          // Image of Certificate

          if(profolio.certs[i].imageData) {
            content.push({
              image: profolio.certs[i].imageData,
              width: 400,
              alignment: 'center'
            });
          } else {
            content.push({
              text: 'No picture of ' + profolio.certs[i].attributes.title + ' was uploaded',
              alignment: 'center',
              fontSize: 20,
              italic: true
            });
          }

          // Issued, Expires, Notes
          var issued = new Date(profolio.certs[i].attributes.issued);
          var issuedString = issued.getMonth() + '/' + issued.getDate() + '/' + issued.getFullYear();

          var expire = new Date(profolio.certs[i].attributes.expiration);
          var expireString = expire.getMonth() + '/' + expire.getDate() + '/' + expire.getFullYear();

          content.push({
            margin: [20,20,20,0],
            table: {
              widths: [40,'auto'],
              body: [
               [ { text: 'Issued', bold: true}, issuedString ],
               [ { text: 'Expires:', bold: true}, expireString],
               [ { text: 'Notes:', bold: true}, profolio.certs[i].attributes.notes]
              ]
            },
            layout: 'noBorders'
          });
        }

        console.log('content created');
        return content;
      }

      return {
        content: createContent(profolio),

        styles: {
          header: {
            fontSize: 18,
            bold: true,
            alignment: 'center'
          },
          tableHeader: {
            bold: true,
            fontSize: 13,
            color: 'black'
          }
        },
        images: {
          medprofolioLogo: 'data:image/png;base64,',
        }
      };
    }
  }
})();
